Jimmy's Australian Food Adventure
Join UK farmer and food lover, Jimmy Doherty, on an epic adventure across Western Australia, South Australia and the Northern Territory as he explores the country's unexpected and inspirational cuisines in 'Jimmy's Australian Food Adventure,
Jimmy's action packed journey takes Jimmy out of the kitchen and into a wide variety of landscapes from crocodile wrangling in the tropical wetlands of the Northern Territory and mud-crabbing in The Kimberley region of Western Australia to turning bee keeper for a day on Kangaroo Island in South Australia.
Along the way Jimmy is joined by Australia's top chefs, brewers, vintners and farmers as he tries out some brand new food innovations including lemonade fruit and a pearl meat sensation.


1)  Wild Food 
In the first episode, the farmer Jimmy explores the unusual wild foods of Western Australia and Northern Territory, encountering salt-water crocodiles, rustling up kangaroo sausages and enjoying Bush camp cooking in true outback style

2)  Foraging 
Jimmy forages for wild plants at Ayers Rock and tries his hand at mud crabbing in the beautiful wilderness of Western Australia's Cape Leveque. There is also a kangaroo tail supper

3)  New Arrivals 
Jimmy dines on an Afghan curry during a visit to the Flinders Ranges in South Australia, and samples the nation's national pudding - Pavlova - during a trip to Kangaroo Island

4)  Innovations 
Jimmy reveals how Australia is getting into the world truffle market and tastes a haute cuisine sensation developed by an enterprising pearl farmer

5)  Fusion 
The farmer concludes his tour of Australia's contemporary food scene in Darwin, where he explores the new tastes that waves of immigrants have introduced to the continent and celebrates the immigrant Greek and Mediterranean communities in the city. He also catches up with top chef Jimmy Shu, who takes him on a tour of an Asian market and treats him to an Asian fusion feast

